import React from 'react';
import { Link } from "react-router-dom";
import '../style/Accueil.css';

const members = [
  { name: "Younes TAOUMI", role: "Team Leader", image: "/images/younes.jpg" },
  { name: "Maryam BADRI", role: "Vice Team Leader", image: "/images/maryam.jpg" },
  { name: "Wiam ABOUTARA BELRHITI", role: "Vice President Project", image: "/images/wiam.jpg" },
  { name: "Ammar MASSAOUDI", role: "Communication Manager", image: "/images/ammar.jpg" },
  { name: "Hind ZAKY", role: "Human Ressources Manager", image: "/images/hind.jpg" },
  { name: "Abdelwadoud EL BAROUJI", role: "Treasurer", image: "/images/abdelwadoud.jpg" },
  { name: "Basma JAWHAR", role: "Event Manager", image: "/images/basma.jpg" },
  { name: "Imane OUAZZANI CHAHDI", role: "Head of partnerships", image: "/images/imane.jpg" },
];

const Accueil = () => {
  return (
    <div>

      <div className="accueil-container">
        <h1>Enactus</h1>
        <p>Enactus FSBM rassemble des étudiants pour développer des projets innovants ayant un impact positif sur la société.</p>
        <Link to="/Apropos">En savoir plus</Link>
      </div>  
    </div>
  );
};

export default Accueil;
